import React from 'react'
import PageHeader from '../../Components/PageHeader'
import PageCampanha from '../../Components/PageCampanha'


const Campanhas = () => {
  return (
    <div className="page-wrapper compact-wrapper" id="pageWrapper">
      <PageHeader/>
      <PageCampanha/>
    </div>
  )
}

export default Campanhas
